import React from "react";

const Footer = () => {
  const year = new Date().getFullYear();
  return (
    <>
      <div className="bg-dark text-light">
        ©️AnkurKumarRay {year} | all rights reserved
      </div>
      ;
    </>
  );
};

export default Footer;
